    window.replaceOilConfig = function (configObj){
      // default values if no config provided
      configObj = configObj || defaultConfig;
      writeCookie(cookieName, JSON.stringify(configObj), 30);
      replaceOilConfigElement(configObj);
    };

    function updateOilConfigFromCookie() {
      var cookieConfig = readCookie(cookieName);
      if (cookieConfig === undefined) return false;
      replaceOilConfigElement(JSON.parse(cookieConfig));
      return true;
    }

    function replaceOilConfigElement(configObj) {
      removeOldConfigElement();
      addNewConfigElement(configObj);
    }

    function addNewConfigElement(configObj, a, b, c, d) {
      b = document;
      c = 'script'
      d = b.createElement(c);
      d.type = 'application/configuration';
      d.id = 'oil-configuration';
      d.innerText = JSON.stringify(configObj);
      a = b.getElementsByTagName(c)[0];
      a.parentNode.insertBefore(d, a);
    }

    function writeCookie(name, value, days) {
      var expires = &quot;&quot;;
      if (days) {
        var date = new Date();
        date.setTime(date.getTime() + (days * 24 * 60 * 60 * 1000));
        expires = &quot;; expires=&quot;+date.toGMTString();
      }
      document.cookie = name + &quot;=&quot; + encodeURIComponent(value) + expires + &quot;;domain=&quot; + getDomain() + &quot;;path=/&quot;;
      return true;
    };

    function readCookie(name) {
      var reString = '(?:(?:^|.*;\\s*)' + name + '\\s*\\=\\s*([^;]*).*$)|^.*$';
      var re = new RegExp(reString);
      var cookieValue = document.cookie.replace(re, &quot;$1&quot;);
      if (!cookieValue) return undefined;
      return decodeURIComponent(cookieValue);
    }

    function removeOldConfigElement() {
      var $old = document.getElementById(&quot;oil-configuration&quot;);
      if ($old &amp;&amp; $old.type == &quot;application/configuration&quot;) {
        // destroy the old iframe if found, set m to null as if it weren't found at all
        $old.parentNode.removeChild($old);
        return false;
      }
      return true;
    }

    // lifted from utag.loader.lh
    function getDomain(a, b, c) {
      a = &quot;&quot; + location.hostname;
      b = a.split(&quot;.&quot;);
      c = (/\.co\.|\.com\.|\.org\.|\.edu\.|\.net\.|\.asn\./.test(a)) ? 3 : 2;
      return b.splice(b.length - c, c).join(&quot;.&quot;);
    }

    var gotConfigFromCookie = updateOilConfigFromCookie();
    if (!gotConfigFromCookie) replaceOilConfigElement(defaultConfig);
